해외 및 다른 도시로 전화하는 가장 저렴한 방법.
- 무료 통화, 인터넷 통화, 회신 및 sms-회신;
- 통화 중 대화 내용 무료 녹음;
- 인터넷 없이 통화;
- 인터넷 연결 품질에 따라 통화 유형을 자동으로 선택;
- 통화 중에 음성을 변경해 보세요;
- 프로그램 없이도 걸려 오는 전화를 수신합니다;
- HD-음성 코덱으로 고품질의 음성 구현;
- 필요한 국가의 가상 번호를 구입할 수 있습니다.
- 매우 저렴한 가격으로 다른 국가 및 도시로 전화할 수 있으며 푸짐한 보너스는 덤입니다;
- 다양한 수준의 제휴 프로그램으로 친구들을 균형 있게 통화 목록에 채우고 무료 통화하세요;
- iPad 또는 iPod에서 전화 거세요;
- Callbacker 사용자에게 SMS 및 무료 메시지를 보내세요;
- 중국, 미국, 프랑스, 브라질, UAE, 독일, 쿠웨이트, 이집트, 멕시코, 나이지리아, 태국, 인도네시아, 호주, 영국 등으로 저렴한 통화

